ber of tasks: 6985 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 4252.19 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 13.98 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 110.75 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 2483.91 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.7.110:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import IncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n    for i in range(len(gt)):\n        pca.partial_fit(gt[i])\n    #l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    #explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    #explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\", cpt , flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1471","type":"YearsTicker"},{"attributes":{"axis":{"id":"1166"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1168","type":"Grid"},{"attributes":{},"id":"1449","type":"NoOverlap"},{"attributes":{"tools":[{"id":"1179"}]},"id":"1169","type":"Toolbar"},{"attributes":{},"id":"1442","type":"AllLabels"},{"attributes":{},"id":"1506","type":"UnionRenderers"},{"attributes":{},"id":"1436","type":"AllLabels"},{"attributes":{"factors":["numpy.ndarray"]},"id":"1187","type":"FactorRange"},{"attributes":{},"id":"1507","type":"Selection"},{"attributes":{},"id":"1451","type":"CategoricalTickFormatter"},{"attributes":{"below":[{"id":"1378"}],"center":[{"id":"1381"},{"id":"1385"}],"height":150,"left":[{"id":"1382"}],"renderers":[{"id":"1397"}],"sizing_mode":"stretch_both","title":{"id":"1369"},"toolbar":{"id":"1389"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1374"},"y_range":{"id":"1372"},"y_scale":{"id":"1376"}},"id":"1368","subtype"
